import { useState } from "react";
import { registerUser } from "../services/authService";
import { useNavigate } from "react-router-dom";

const Register = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [rol, setRol] = useState("usuario"); // valor por defecto
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await registerUser(email, password, rol);
      navigate("/dashboard");
    } catch (error) {
      alert("Error al registrar usuario: " + error.message);
    }
  };

  return (
    <div className="container mt-5">
      <h2>Registro de usuario</h2>
      <form onSubmit={handleSubmit} className="mt-3">
        <div className="mb-3">
          <label>Email</label>
          <input className="form-control" type="email" onChange={(e) => setEmail(e.target.value)} required />
        </div>
        <div className="mb-3">
          <label>Contrase√±a</label>
          <input className="form-control" type="password" onChange={(e) => setPassword(e.target.value)} required />
        </div>
        <div className="mb-3">
          <label>Rol</label>
          <select className="form-select" value={rol} onChange={(e) => setRol(e.target.value)}>
            <option value="usuario">Usuario</option>
            <option value="admin">Administrador</option>
          </select>
        </div>
        <button type="submit" className="btn btn-success">Registrarse</button>
      </form>
    </div>
  );
};

export default Register;
